DROP TABLE IF EXISTS `dim_category`;
CREATE TABLE `dim_category`  (
                                 `category_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '类目唯一标识（格式如C1）',
                                 `category_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类目名称（如“手机”）',
                                 `parent_category_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '父类目ID（根类目为ROOT）',
                                 `is_leaf` int(1) NULL DEFAULT NULL COMMENT '是否为叶子类目：0-非叶子类目（有子类目），1-叶子类目（最末级）',
                                 PRIMARY KEY (`category_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品类目维度表' ROW_FORMAT = Dynamic;
#
#
#
DROP TABLE IF EXISTS `dwd_payment`;
CREATE TABLE `dwd_payment`  (
                                `payment_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '支付记录唯一标识（格式如PAY00001）',
                                `order_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单ID（关联dwd_order.order_id）',
                                `user_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户ID（关联dim_user.user_id）',
                                `payment_time` varchar(20) NULL DEFAULT NULL COMMENT '支付完成时间（格式：YYYY-MM-DD HH:MM:SS）',
                                `payment_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际支付金额（扣除优惠后的金额）',
                                `payment_channel` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付渠道：PC-电脑端支付，无线-手机端支付',
                                `is_juhuasuan` int(1) NULL DEFAULT NULL COMMENT '是否聚划算活动：0-否，1-是',
                                PRIMARY KEY (`payment_id`) USING BTREE,
                                INDEX `order_id`(`order_id`) USING BTREE,
                                CONSTRAINT `dwd_payment_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `dwd_order` (`order_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '支付明细表' ROW_FORMAT = Dynamic;
#
DROP TABLE IF EXISTS `dim_product`;
CREATE TABLE `dim_product`  (
                                `product_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品唯一标识（格式如P0001）',
                                `product_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品名称（如“电子产品-黑色”）',
                                `category_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '叶子类目ID（关联dim_category.category_id）',
                                `price_bin` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '价格区间分档（硬编码值，如0-50、51-100等）',
                                `goods_status` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品状态：上架-可售卖，下架-不可售卖',
                                PRIMARY KEY (`product_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品维度表' ROW_FORMAT = Dynamic;
#
#
#
#
DROP TABLE  `dim_user`;
CREATE TABLE `dim_user`  (
                             `user_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户唯一标识（格式如U001）',
                             `register_date` varchar(20) NULL DEFAULT NULL COMMENT '用户注册日期（格式：YYYY-MM-DD）',
                             `is_new_user` int(1) NULL DEFAULT NULL COMMENT '是否新用户：0-老用户（注册超过365天），1-新用户（注册未满365天）',
                             PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户维度表' ROW_FORMAT = Dynamic;
#
#
#
DROP TABLE IF EXISTS `dwd_order`;
CREATE TABLE `dwd_order`  (
                              `order_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单唯一标识（格式如O00001）',
                              `user_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户ID（关联dim_user.user_id）',
                              `product_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品ID（关联dim_product.product_id）',
                              `order_time` varchar(20) NULL DEFAULT NULL COMMENT '下单时间（格式：YYYY-MM-DD HH:MM:SS）',
                              `payment_status` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付状态：已支付/未支付',
                              `order_quantity` int(11) NULL DEFAULT NULL COMMENT '下单数量（购买的商品件数）',
                              `order_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '下单金额（用户拍下时的总金额，未实际支付）',
                              `terminal_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下单终端：PC-电脑端，无线-手机/Pad端',
                              PRIMARY KEY (`order_id`) USING BTREE,
                              INDEX `user_id`(`user_id`) USING BTREE,
                              INDEX `product_id`(`product_id`) USING BTREE,
                              CONSTRAINT `dwd_order_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `dim_user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
                              CONSTRAINT `dwd_order_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `dim_product` (`product_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单明细表' ROW_FORMAT = Dynamic;
#
#
DROP TABLE IF EXISTS `dwd_refund`;
CREATE TABLE `dwd_refund`  (
                               `refund_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '退款记录唯一标识（格式如REF00001）',
                               `order_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单ID（关联dwd_order.order_id）',
                               `refund_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '退款金额（实际退还给用户的金额）',
                               `refund_time` varchar(20) NULL DEFAULT NULL COMMENT '退款处理时间（格式：YYYY-MM-DD HH:MM:SS）',
                               `refund_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款类型：仅退款-不退货退钱，退货退款-退货并退款',
                               PRIMARY KEY (`refund_id`) USING BTREE,
                               INDEX `order_id`(`order_id`) USING BTREE,
                               CONSTRAINT `dwd_refund_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `dwd_order` (`order_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '退款明细表' ROW_FORMAT = Dynamic;

