DROP TABLE IF EXISTS `dwd_user_behavior_log`;
CREATE TABLE `dwd_user_behavior_log`  (
                                          `log_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志记录唯一ID（自增主键）',
                                          `user_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户ID（关联dim_user.user_id）',
                                          `product_id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品ID（关联dim_product.product_id）',
                                          `behavior_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '行为类型：访问/收藏/加购/点击',
                                          `behavior_time` varchar(20) NULL DEFAULT NULL COMMENT '行为发生时间（格式：YYYY-MM-DD HH:MM:SS）',
                                          `terminal_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '终端类型：PC-电脑端，无线-手机/Pad端',
                                          `stay_duration` int(11) NULL DEFAULT NULL COMMENT '停留时长（单位：秒）',
                                          `is_bounce` int(1) NULL DEFAULT NULL COMMENT '是否跳出页面：0-未跳出（有后续操作），1-跳出（无后续操作）',
                                          PRIMARY KEY (`log_id`) USING BTREE,
                                          INDEX `user_id`(`user_id`) USING BTREE,
                                          INDEX `product_id`(`product_id`) USING BTREE,
                                          CONSTRAINT `dwd_user_behavior_log_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `dim_user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
                                          CONSTRAINT `dwd_user_behavior_log_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `dim_product` (`product_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 5001 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户行为日志明细表' ROW_FORMAT = Dynamic;
